contracts/CarbonEmission.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@chainlink/contracts/src/v0.8/shared/access/ConfirmedOwner.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract CarbonEmission is ChainlinkClient, ConfirmedOwner {
    using Chainlink for Chainlink.Request;

    // Sepolia network configurations
    bytes32 private jobId;
    uint256 private fee;


    // Struct to store flight emission data
    struct FlightEmission {
        string departure;
        string destination;
        uint256 passengers;
        string tripType; // "direct" or "round"
        uint256 emission;
        uint256 timestamp;
        bool fulfilled;
    }

    // Mapping to store flight emissions for each user
    mapping(address => FlightEmission[]) public userFlights;
    mapping(bytes32 => address) private requestToUser;
    mapping(bytes32 => uint256) private requestToFlightIndex;

    // Events
    event EmissionRequested(
        bytes32 indexed requestId,
        string departure,
        string destination,
        uint256 passengers,
        string tripType
    );
    event EmissionReceived(
        bytes32 indexed requestId,
        uint256 emission
    );

    constructor() ConfirmedOwner(msg.sender) {
        _setChainlinkToken(0x779877A7B0D9E8603169DdbD7836e478b4624789);
        _setChainlinkOracle(0x6090149792dAAeE9D1D568c9f9a6F6B46AA29eFD);
        jobId = "ca98366cc7314957b8c012c72f05aeeb";
        fee = (1 * LINK_DIVISIBILITY) / 10; // 0,1 * 10**18 (Varies by network and job)
    }

    function requestEmissionData(
        string memory _departure,
        string memory _destination,
        uint256 _passengers,
        uint256 _emissionRate,
        string memory _tripType) public returns (bytes32 requestId) {
        
        // Create the API request
        Chainlink.Request memory req = _buildChainlinkRequest(
            jobId,
            address(this),
            this.fulfill.selector
        );

        // Build the API URL with query parameters
        string memory url = string(
            abi.encodePacked(
                "https://carbon-emission-nine.vercel.app/api/calculate-emission?departure=",
                _departure,
                "&destination=",
                _destination,
                "&passengers=",
                Strings.toString(_passengers),
                "&tripType=",
                _tripType
            )
        );

        // Set the URL and path for the emission data
        req._add("get", url);
        req._add("path", "data,emission"); // Path in JSON response

        // Store flight data
        FlightEmission memory newFlight = FlightEmission({
            departure: _departure,
            destination: _destination,
            passengers: _passengers,
            tripType: _tripType,
            emission: _emissionRate,
            timestamp: block.timestamp,
            fulfilled: false
        });

        userFlights[msg.sender].push(newFlight);
        
        // Send the request
        requestId = _sendChainlinkRequest(req, fee);
        
        // Store request mappings
        requestToUser[requestId] = msg.sender;
        requestToFlightIndex[requestId] = userFlights[msg.sender].length - 1;

        emit EmissionRequested(requestId, _departure, _destination, _passengers, _tripType);
    }

    function fulfill(
        bytes32 _requestId,
        uint256 _emission
    ) public recordChainlinkFulfillment(_requestId) {
        emit EmissionReceived(_requestId, _emission);
        address user = requestToUser[_requestId];
        uint256 flightIndex = requestToFlightIndex[_requestId];
        
        userFlights[user][flightIndex].emission = _emission;
        userFlights[user][flightIndex].fulfilled = true;

       
    }

    function getUserFlights(address _user) public view returns (FlightEmission[] memory) {
        FlightEmission[] memory flights = userFlights[_user];
        uint256 count = flights.length;

        require(count > 0, "No flight data available");

        FlightEmission[] memory result = new FlightEmission[](count);

        for (uint256 i = 0; i < count; i++) {
            result[i] = flights[i];
        }

        return result;
    }

    function getLatestFlight(
        address _user
    ) public view returns (FlightEmission memory) {
        require(userFlights[_user].length > 0, "No flights found");
        return userFlights[_user][userFlights[_user].length - 1];
    }

    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(_chainlinkTokenAddress());
        require(
            link.transfer(msg.sender, link.balanceOf(address(this))),
            "Unable to transfer"
        );
    }
}

contracts/EcoToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract EcoToken is ERC20, Ownable {
    struct Stake {
        uint256 amount;
        uint256 startTime;
    }

    uint256 public rewardRate = 10; // Reward rate (e.g., 10% annual reward rate)
    mapping(address => Stake) public stakes;
    mapping(address => uint256) public rewards;
    mapping(address => bool) public approvedMinters; // List of addresses approved to mint tokens

    event TokensStaked(address indexed user, uint256 amount);
    event TokensUnstaked(address indexed user, uint256 amount, uint256 reward);
    event MinterApproved(address indexed minter, bool status);

    constructor() ERC20("EcoToken", "ECO") {
        _mint(msg.sender, 1000000 * 10 ** decimals()); // Initial supply to contract owner
    }

    // Function to mint tokens; only the owner or approved minters can call this
    function mint(address to, uint256 amount) external {
        require(approvedMinters[msg.sender] || msg.sender == owner(), "Not authorized to mint");
        _mint(to, amount);
    }

    // Function to set or remove a minter; only the owner can call this
    function setMinter(address minter, bool canMint) external onlyOwner {
        approvedMinters[minter] = canMint;
        emit MinterApproved(minter, canMint);
    }

    // Function to allow users to stake tokens
    function stakeTokens(uint256 amount) external {
        require(balanceOf(msg.sender) >= amount, "Insufficient balance to stake");
        require(stakes[msg.sender].amount == 0, "Already staking");

        _transfer(msg.sender, address(this), amount);

        stakes[msg.sender] = Stake({
            amount: amount,
            startTime: block.timestamp
        });

        emit TokensStaked(msg.sender, amount);
    }

    // Function to calculate rewards based on the staking period
    function calculateReward(address user) public view returns (uint256) {
        Stake memory userStake = stakes[user];
        if (userStake.amount == 0) return 0;

        uint256 stakingDuration = block.timestamp - userStake.startTime;
        uint256 annualReward = (userStake.amount * rewardRate) / 100;
        uint256 reward = (annualReward * stakingDuration) / 365 days;

        return reward;
    }

    // Function to unstake tokens and claim rewards
    function unstakeTokens() external {
        Stake memory userStake = stakes[msg.sender];
        require(userStake.amount > 0, "No active stake");

        uint256 reward = calculateReward(msg.sender);

        stakes[msg.sender].amount = 0;
        stakes[msg.sender].startTime = 0;

        _transfer(address(this), msg.sender, userStake.amount + reward);
        emit TokensUnstaked(msg.sender, userStake.amount, reward);
    }

    // Function to update reward rate, only callable by the owner
    function setRewardRate(uint256 newRate) external onlyOwner {
        rewardRate = newRate;
    }
}

